import React from 'react';
import PropTypes from 'prop-types';
import { Box, Text } from '../../styles';

const Tiles = ({ items }) => <Box></Box>;

Tiles.propTypes = {
  items: PropTypes.arrayOf(PropTypes.object).isRequired,
};

export default Tiles;
